class Solution(object):
    def maxVowels(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """

        # while k<=len(s):
        #     sub=s[:k]
        #     counts.append(sub.count('a')+sub.count('e')+sub.count('i')+sub.count('o')+sub.count('u'))
        #     s=s[1:]
        # if s is None:
        #     return 0
        count=0
        for i in range(len(s)-k+1):
            sub=s[i:i+k]
            # counts.append(sub.count('a') + sub.count('e') + sub.count('i') + sub.count('o') + sub.count('u'))
            count=max(count,sum(map(sub.count,['a','e','i','o','u'])))

        # onetwo = []
        # for letter in s:
        #     if letter =='a' or letter=='e' or letter=='i' or letter=='o' or letter=='u':
        #         onetwo.append(1)
        #     else:
        #         onetwo.append(0)
        #
        # counts=[]
        # while k <=len(onetwo):
        #     x=onetwo[:k]
        #     counts.append(sum(onetwo[:k]))
        #     onetwo=onetwo[1:]

        return count

